import {
  Button,
  Container
} from "react-bootstrap";
 const Http = ()=>{
  const design = (
    <>
      <Container className="py-4 d-flex">
      <div>
        <h2>Comment</h2>
      </div>
      <div>
        <Button variant='success' >New Comment</Button>
      </div>
      </Container>
    </>
  );
  return design;
}

export default Http;
